import React from "react";
import Navbar from "react-bootstrap/Navbar";import Button from "react-bootstrap/Button";
import Nav from "react-bootstrap/Nav";


const Head = (props) => {
    return(
        <header>
            <Navbar>
                <Navbar.Brand>
                    Nyleesia Nicome Schnarr
                </Navbar.Brand>

                <Nav>
                    <Nav.Link
                        href = "projects" > Projects </Nav.Link>

                    <Nav.Link
                        href = "contact">Contact  

                    </Nav.Link>      
                    </Nav>               


            </Navbar>

        </header>
    )
}

export default Head;
